🫶🏾🌍 I'm proud to announce that I'll be joining forces with @Remakeourworld as a founding fellowship member, along with 24 other creatives within the fashion industry. Why?

Today, over 100 billion garments are produced annually for less than 8 billion people worldwide. This massive overproduction places fast fashion in critical opposition with the planet’s natural capacity to support life on earth. While the rate that clothing is produced comes at a cost to the environment, it comes at a larger cost to the women who make them. 

Here enters the story of 70 million garment workers. 80% are women of color and forced to work in unsafe factory conditions with limited access to fresh air or natural light. Worst of all, gender-based violence is common inside these workplaces. Remake is on a mission to change this. 

Together, through collective action, we can disrupt the $2.5 trillion dollar clothing industry and connect the industry’s biggest problems with viable solutions. 

For me, working with Remake means bringing these conversations regarding sustainable fashion mainstream and creating more visibility to ethical fashion brands that are accessible to all people, regardless of size, gender, or socioeconomic background— especially those designed and championed by Black and Brown people. This type of work requires a strong community, education, and a mutual understanding of how the need for equality and sustainability intersect. 

It’s all Love, but let’s work! 🫶🏾🌍🫶🏾🌍🫶🏾

